The Sitter

Wanna take the babysitter home? What's sexier than a hot little 18 year old babysitter coming over with her and watching the kids while you and the wife go out for a night on the town? Well, imagine a couple that enjoys hiring various babysitters just for fun and games. Well, everyone wins... the babysitter gets paid for a night's work, and the couple gets to live out their fantasies with a cute little piece of ass. The twist? The couple doesn't have a baby. But it doesn't seem to be a problem for anyone involved. Can you stay the night?
